import React from "react";
import AuthService from "../services/auth.service";
import { Link, useHistory, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import bg from "../images/wbg.jpg";
let p = localStorage.getItem("username");
let j=localStorage.getItem("jwt");
const Profile = () => {
     const navigate = useNavigate();
  const logOut = () => {
    AuthService.logout();
    navigate("/");
  };
  const [user, setFaculty] = useState([]);
  const init = () => {
    AuthService.getUser(p)
      .then((response) => {
        console.log("Printing faculty data", response.data);
        setFaculty(response.data);
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };
    useEffect(() => {
      init();
    }, []);
  return (
    <div
      className="container"
      style={{
        backgroundImage: "url(" + bg + ")",
        backgroundSize: "cover",
        height: "",
        backdropFilter: "blur",
      }}
    >
      <header className="jumbotron">
        <h3>
          <strong>{user.username}</strong> Profile
        </h3>
      </header>
      <p>
        <strong>Token:{j}</strong>
      </p>
      <p>
        <strong>Id:</strong> {user.id}
      </p>
      <p>
        <strong>Email:</strong> {user.emailId}
      </p>
      <strong>Authorities:</strong>
      <ul>{user.roles}</ul>
      <ul>
        <button
          className="btn btn-danger ml-2"
          onClick={() => {
            logOut();
          }}
        >
          LOGOUT
        </button>
      </ul>
    </div>
  );
};
export default Profile;
